	}

	render(){
		return(
			<div className="home">	
				<div className="welcome">
					<h1>Welcome to Team Up</h1>
					<div onMouseEnter={this.handleMouseEnter}
                    onMouseLeave={this.handleMouseLeave}>
						<img src={team1} style={{
							width: "100%",
							height: "auto",
							zIndex:2,
							opacity: 1,
							marginBottom:"1vw"
						}} className={"team1"}/>
					</div>
				</div>
			</div>
			)
	}
}
export default Home;
